package client.components;

public class Result {
	private int result;
	private String data;
	
	public Result(int result, String data) {
		// TODO Auto-generated constructor stub
		this.result = result;
		this.data = data;
	}

	public int getResult() {
		return result;
	}

	public void setResult(int result) {
		this.result = result;
	}

	public String getData() {
		return data;
	}

	public void setData(String data) {
		this.data = data;
	}
	
	
}
